fields.about:
Текст для титула интернет-магазина должен оставлять после себя хорошее впечатление и подтверждать надежную репутацию. На главной странице стоит вкратце рассказать, что представляет собой ресурс, и что именно вы здесь продаете. Подумайте и перечислите на титуле выгоды, которые ждут ваших покупателей при сотрудничестве. Напишите, чем вы выделяетесь на фоне своих конкурентов. В этот список могут попасть:

уникальный товар;
специфическая аудитория;
необычное обслуживание;
огромный ассортимент;
выгодные системы бонусов и скидок;
особое отношение к клиентам;
надежные гарантии;
внушительный склад.

