fields.about_en:
The text for the title of the online store should leave a good impression and confirm a reliable reputation. On the main page, you should briefly tell what the resource is, and what exactly you are selling here. Think about it and list on the title the benefits that await your customers in cooperation. Write down how you stand out from your competitors. This list may include:

unique product;
specific audience;
unusual service;
huge assortment;
profitable bonus and discount systems;
special attitude to customers;
reliable guarantees;
an impressive warehouse.

